import React from "react";

function LoaderBs() {
  return (
    <div className="my-4 text-center">
      <div className="spinner-border text-muted" role="status">
        <span className="visually-hidden">Loading...</span>
      </div>
    </div>
  );
}

export default LoaderBs;
